import { Navbar, Container, Nav, NavDropdown } from "react-bootstrap";
import { DataContext } from "../../Data/DataContext";
import { useContext } from "react";
import { NavLink } from "react-router-dom";
function Home() {
  const [nav, setNav] = useContext(DataContext);
  return (
    <Navbar collapseOnSelect expand="lg" style={{ backgroundColor: "#5B5EA6" }}>
      <Container>
        <NavLink to="../home" style={{ color: "white" }}>
          Touch-Dashboard
        </NavLink>

        <label style={{ color: "white" }}>{nav}</label>

        <div
          style={{
            border: "white solid 1px",
            borderRadius: "100px",
            width: "40px",
            height: "40px",
          }}
        >
          <center>
            <img src="./assets/icons/bell.svg" fill="white" width={20} />
          </center>
        </div>
      </Container>
    </Navbar>
  );
}

export default Home;
